import React from 'react';
import ReactDOM from 'react-dom';


function Card() {
    return(
        <div className="cards">
        <div className="card">
            <img src="https://wallpapercave.com/wp/wp4056410.jpg" alt="mypic" className="cardimg" />
            <div className="cardinfo">
                <span className="classcategory"> A Netflix Original Series </span>
                <h3 className="cardtitle"> DARK </h3>
                <a href="https://www.netflix.com/title/80157072" target="_blank">
                    <button> Watch Now </button>
                </a>
            </div>
        </div>
    </div>
    )
}

ReactDOM.render(
    <div>
    <Card />
    </div>,

    document.getElementById("root")
);
